import React from "react";
import logo from "../images/smile.jpg";

function Headeris(props) {
  return (
    <header className={props.klase} style={props.stilius}>
      <img src={require("../images/" + props.logo)} width={props.logo_plotis} />
    </header>
  );
}

export default Headeris;
